Defendant Abigail Baez in court with attorney Susan M Roth.  Benjamin A Wesson appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
AS TO COUNT 3:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 2 YEARS, CONSECUTIVE with Count 4 AND any other sentence with credit for 0 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 1 YEAR.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 1 YEAR.

The defendant IS NOT eligible for the Challenge Incarceration Program or the Substance Abuse Program.  The Court STAYED this sentence and placed the defendant on probation for a period of 30 MONTHS with the following conditions.

CONDITIONS OF PROBATION:
*Obtain AODA assessment and if necessary, complete follow-up care/treatment;
*Absolute sobriety with screens as to drugs and alcohol;
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victims Nicolas F., Aaron R., Alexandre J.-S., Elizabeth L., Karissa H., Mitchell H. and co-actors Mary Molale, Willmarvin Diaz-Boria, Jeriel Rodriguez, and Erik Tejada;
*Obtain/maintain full time employment or full time school with part time employment;
*Participate in Cognitive Thinking program;
*Obtain GED or HSED;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

AS TO COUNT 4:  The Court sentenced the defendant to serve 5 MONTHS in the House of Corrections with Huber release for employment and day reporting center for education, work search, vocational training, cognitive thinking program, Consecutive to Count 3 and to any other sentence with credit for 7 days time served.  GOOD TIME ALLOWED.  NO ELECTRONIC MONITORING.  This sentence is STAYED until 6-17-14.  Defendant to report to the House of Corrections by 12pm.

AS TO BOTH COUNTS:

Defendant to pay applicable mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment.  State in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $75.00 payable to Aaron R.- to be paid first and within the first year of probation period.  Restitution is joint and several with any co-actor ultimately convicted and sentenced in this matter (cases 14CF293-14CF296).  If revoked, the Court ordered all financial obligations and restitution to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Defendant is informed she may not possess and/or own any firearms.  Defendant is informed she may not vote in any election until her civil rights have been reinstated.  Defense motion for expungement heard and granted by the court contingent upon successful completion of all conditions of probation (i.e. no violation, pay all costs and restitution, obtain GED, etc).  Appeal rights given by the Court. 
